import React from 'react'
import { Outlet,Navigate } from 'react-router-dom';

const Privateroute=()=>{
    let loggedIn = false;

    if(loggedIn){
        return <Outlet/>
    }
    else{
        return <Navigate to={"/login"}/>;
        
    }
}

export default Privateroute;
